import styled from "styled-components";



const ImgContainer = styled.div`
    position:relative;
    width:200px;
    height:250px;
    background-color:red;
    margin:20px;
    overflow:hidden;
    border-radius:5px;

    img{
      position:relative;
      width:100%;
      height:100%;
      background-position:center;
      object-fit:cover;
    }

    &:hover{
      cursor:pointer;
    }
`;

const Icons = styled.div`
      position:absolute;
      top:0;
      left:0;
      width:100%;
      height:100%;
      backgorund-color:red;
      z-index:2;
`;



function AnimalControl({item}) {
  return (
      <ImgContainer>
        <Icons></Icons>
        <img src={item.Image}/>
      </ImgContainer>
  )
}

export default AnimalControl;
